import { makeStyles } from "@material-ui/core";
import { red } from "@material-ui/core/colors";

const homePageStyles = makeStyles({
  root: {
    backgroundColor: red[100],
    width: "100vw",
    height: "100vh",
    overflowX: "hidden",
  },
});

export default homePageStyles;
